#include <stdio.h>

int trocos(int valor){
	
    int trocar [8]={200, 100, 50, 20, 10, 5, 2, 1};
    int i, a=0;
    
    for(i=0;i<8;i++){
		while(valor>=200){
			valor=valor-trocar[i];
			a++;
		}
	}
    return a;
}

int main() {

    float valor;
    int a=0;
    
    scanf("%f", &valor);
    
    valor=valor*100.0;
    a= trocos(valor);
   
    printf("Moedas de 2 euros: %d", a);
    
}
